import { Button, CardContent, Typography } from "@mui/material";
import Card from "@mui/material/Card";

const Dashboard = () => {
  return (
    <div>
      <Card sx={{ width: "355.41px", height:"181px",backgroundColor: "#9b9b9b", color: "#fff", display: "flex",
            justifyContent: "center",
            flexDirection: "column",
            alignItems: "center",}}>
        
          <Typography
            sx={{ fontSize: "30px", fontWeight: "400", lineHeight: "34.47px" }}
          >
            Wallet Balance: {" "}
            <span style={{ color: "rgba(157, 255, 91, 1)", fontWeight: "700" }}>
              &#x20B9; 4500
            </span>
          </Typography>
          <Button
            sx={{
              width: "80%",
              color: "#fff",
              backgroundColor: "rgba(181, 220, 82, 1)",
              borderRadius: "15px",
            }}
          >
            + Add Income
          </Button>
      </Card>
    </div>
  );
};

export default Dashboard;
